import React from 'react'

class URL extends React.Component{
    constructor(props){
        super(props)
        this.state={
            protocolo:this.props.protocolo
        }
    }

    render(){
        return(
            <div>
                <input type="text"
                    placeholder="Ingresa tu nuevo link."
                    
                />
            </div>
        )
    }
}

export default URL
